import React from 'react';
import Grid from '@material-ui/core/Grid';

function Education (props) {
    return (
        <Grid container >
            <Grid item col={4} style={{padding:'1rem 0 0 0.5rem'}}>
                <p>{props.startYear} - {props.endYear}</p>
            </Grid>
            <Grid item col={8} style={{paddingLeft:'5rem'}}>
                <h4 style={{marginTop:'0.5rem'}}>{props.schoolName}</h4>
                <p>{props.schoolAchievement} <br /> {props.schoolgpa}</p>
            </Grid>
        </Grid>
    )
}

export default Education
